    <form>
      <div>
        <input type="text" placeholder="login" />
      </div>
      <div>
        <input type="text" placeholder="password" />
      </div>
      <div>
        <input type={"checkbox"} /> remember me
      </div>
      <div>
        <button>Login</button>
      </div>
    </form>
  );
};

export const ReduxLoginForm = reduxForm({ form: "login" }(LoginForm));
